import React from 'react'

function Card(props) {
  return (
    <div className='card'>
        <dt>
        <img className='circle-img'
        src={require(`${props.img}`)} 
        alt="pokepic"/>
            <span>
                {props.name}
            </span>
        </dt>
        <dd>
            {props.text}
        </dd>
    </div>
  )
}

export default Card
